import "./Register.css";
import Navbar from "../../components/navbar/Navbar";

const Register = () => {
  return (
    <div>
      <Navbar />
      <div className="container">
        <h1>Sign Up</h1>
        <form action="" className="container"></form>
      </div>
    </div>
  );
};

export default Register;
